  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main />}/>
          <Route path="/intro" element={<About />}/>
          <Route path="/easy" element={<Easy />}/>
        </Routes>
      </BrowserRouter>
    </div>
  )

}
